import React from "react";
import "./item.css";
import { Link } from "react-router-dom";

const Item = ({ id, nombre, precio, img }) => {
  return (
    <div className="item">
      <img src={img} alt={nombre} />
      <h3> nombre:{nombre} </h3>
      <p>Precio: {precio}</p>
      <p>Id:{id}</p>
      <Link to={`item/${id}`}>Ver Detalles</Link>
    </div>
  );
};

export default Item;
